function Get-DecodeBase64Image {
    param (
        [Parameter(Mandatory = $true)]
        [String]$imageBase64
    )
    # Parameter help description
    $objBitmapImage = New-Object System.Windows.Media.Imaging.BitmapImage
    $objBitmapImage.BeginInit()
    $objBitmapImage.StreamSource = [System.IO.MemoryStream][System.Convert]::FromBase64String($imageBase64)
    $objBitmapImage.EndInit()
    $objBitmapImage.Freeze()
    return $objBitmapImage
}

function Add-XamlEvent{
    param(
      [Parameter(Mandatory = $true)]  
      $object,
      [Parameter(Mandatory = $true)]
      $event,
      [Parameter(Mandatory = $true)]
      $scriptBlock
    )
  
    try {
        if($object)
        {
            $object."$event"($scriptBlock)
        }
        else 
        {
            $global:txtSplashText.Text = "Event  $($object.Name) loaded successfully"
  
        }
    }
    catch 
    {
        Write-Error "Failed load event $($object.Name). Error:" $_.Exception
    }
  }
###########################################################################################################
############################################## Start ######################################################
###########################################################################################################


Add-Type -AssemblyName PresentationFramework
Add-Type -AssemblyName System.Windows.Forms

$mainWindowXaml = @'
<Window
	xmlns="http://schemas.microsoft.com/winfx/2006/xaml/presentation"
	xmlns:x="http://schemas.microsoft.com/winfx/2006/xaml"
    Title="Smartphone Replacement" Height="800" Width="1200" MinWidth="1200" MinHeight="800"
    Style="{DynamicResource MaterialDesignWindow}" 
    WindowStartupLocation="CenterScreen"
    ResizeMode="CanResize"
    TextElement.FontFamily="Roboto"
    Background="#FF1B1A19">
    <Grid>
        <Grid.RowDefinitions>
            <RowDefinition Height="143*"/>
            <RowDefinition Height="150*"/>
            <RowDefinition Height="491*"/>
        </Grid.RowDefinitions>
        <Label Content="Smartphone Replacement - Select your new Model" HorizontalAlignment="Center" VerticalAlignment="Center" FontSize="48" HorizontalContentAlignment="Stretch" VerticalContentAlignment="Center" Foreground="#DDFFFFFF" FontWeight="Bold"/>
        <Label Content="Dear user, you are in the current smartphone replacement wave. Please choose one of the smartphone models shown below." HorizontalAlignment="Left" Margin="20,0,0,0" Grid.Row="1" VerticalAlignment="Center" HorizontalContentAlignment="Center" VerticalContentAlignment="Center" Foreground="#DDFFFFFF" FontSize="18"/>
        <Grid Grid.Row="2">
            <Grid.ColumnDefinitions>
                <ColumnDefinition/>
                <ColumnDefinition/>
            </Grid.ColumnDefinitions>
            <StackPanel>
                <Image HorizontalAlignment="Center" Height="400" Margin="0,0,0,0" VerticalAlignment="Center" Width="400" x:Name="ImageApple"/>
                <Button Background="#FFEDEDEC" HorizontalAlignment="Center" VerticalAlignment="Center" Content="Select iPhone" Foreground="Black" Width="200" Height="50" Margin="0,20,0,0" x:Name="ButtonApple"/>
            </StackPanel>

            <StackPanel Grid.Column="1">
                <Image HorizontalAlignment="Center" Height="400" Margin="0,0,0,0" VerticalAlignment="Center" Width="400" x:Name="ImageAndroid"/>
                <Button Background="#FFEDEDEC" HorizontalAlignment="Center" VerticalAlignment="Center" Content="Select Android" Foreground="Black" Width="200" Height="50" Margin="0,20,0,0" x:Name="ButtonAndroid"/>
            </StackPanel>

        </Grid>
    </Grid>
</Window>
'@

$appleLogo = ""
$androidLogo = ""


# Load windows
$inputXML = $mainWindowXaml
$inputXML = $inputXML -replace 'mc:Ignorable="d"', '' -replace "x:N", 'N' -replace '^<Win.*', '<Window'
[XML]$xaml = $inputXML
$reader = (New-Object System.Xml.XmlNodeReader $xaml)
try {
    $window = [Windows.Markup.XamlReader]::Load( $reader )
} catch {
    Write-Warning $_.Exception
    throw
}

$xaml.SelectNodes("//*[@Name]") | ForEach-Object {
    try {
        Set-Variable -Name "WPF$($_.Name)" -Value $window.FindName($_.Name) -ErrorAction Stop
    } catch {
        throw
   }
}

$WPFImageApple.source = Get-DecodeBase64Image -ImageBase64 $appleLogo
$WPFImageAndroid.source = Get-DecodeBase64Image -ImageBase64 $androidLogo
$user = (Get-WMIObject -ClassName Win32_ComputerSystem).Username
Add-XamlEvent -object $WPFButtonApple -event "Add_Click" -scriptBlock {
    Write-Host ('{"Username" : "' + $user + '", "Selection" : "Apple"}')
    $window.Close()
}
Add-XamlEvent -object $WPFButtonAndroid -event "Add_Click" -scriptBlock {
    Write-Host ('{"Username" : "' + $user + '", "Selection" : "Android"}')
    $window.Close()
}

$Null = $window.ShowDialog()


